Description:
Chào các bạn, 
Mình cần lấy hình ảnh từ web truyện này về bằng php ví dụ: http://nhattruyen.com/truyen-tranh/dinh-cap-vo-hon/chap-31/688425 
Mình dùng Ham CURL 
$ch = curl_init('http://truyenimage.net/data/images/4660/658604/003.jpg?data=nht'); 
 $fp = fopen(APP_PATH . '/public/userfiles/story/a.jpg', 'wb'); 
 curl_setopt($ch, CURLOPT_FILE, $fp); 
 curl_setopt($ch, CURLOPT_HEADER, 0); 
 curl_exec($ch); 
 curl_close($ch); 
 fclose($fp); 
